import React from 'react';
import { useParams } from 'react-router';

const UpdateTour = () => {
    const { id } = useParams();
    return (
        <div>
            <h1>Update your tour package </h1>
            <small>{id}</small>
        </div>
    );
};

export default UpdateTour;
